import React from "react";

const ContactsList = ({ contacts }) => {
  console.log(contacts);
  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>num</th>
            <th>Contact</th>
            <th>Number</th>
          </tr>
        </thead>
        <tbody>
          {contacts.map((contact, index) => (
            <tr key={contact.id}>
              <td>{index+1}</td>
              <td>{contact.name}</td>
              <td>{contact.number}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ContactsList;
